  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  nav: NavComponent;
  @ViewChild(NavComponent) nav: NavComponent;
  title = 'petstore-web';

  rootPage: any = "login";

}
